pragma solidity ^0.4.11;
import '../node_modules/zeppelin-solidity/contracts/math/SafeMath.sol';

contract Operate{
	using SafeMath for uint256;
	address private owner;

	event Award(address to,uint256 val);

	function Operate(){
		owner = msg.sender;
	}

	//call this function to deposit to this contract
  	function deposit() payable public{

  	}


  	function transfer(address to, uint256 val) public view returns(bool) {
	    require (msg.sender==owner);//only contract owner can call this function
	    assert (val>0 && this.balance>=val);
	    to.transfer(val);
	    Award(to,val);
	    return true;
  	}

  	function batchTransfer(address[] addrs,uint256[] vals) public view returns(bool) {
	    require (msg.sender==owner);//only contract owner can call this function
	    require(addrs.length>0 && addrs.length==vals.length);
	    for(uint j=0;j<addrs.length;j++){
	      uint256 val = vals[j];
	      assert (val>0 && this.balance>=val);
	      addrs[j].transfer(val);
	      Award(addrs[j],val);
	    }

	    return true;
  	}
}
